        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    }
  }
}
</VARIABLES>

<SUMMARY>
A simple utility model combining fairness and self-interest. The model uses two learnable parameters: a fairness parameter (β) constrained to [0,1] and a self-interest parameter (γ) constrained to [0,1]. The utility is calculated as a function of the difference between the proposed shares and the participant's token contribution.
</SUMMARY>

This model is a simple extension of the previous models, incorporating the fairness and self-interest mechanisms. The learnable parameters β and γ capture the importance of fairness and self-interest in the participant's decision-making, respectively. The model can be used to predict the utility of accepting or rejecting an offer, and the learnable parameters can be calibrated using the data.

